import React from 'react';
import '~video-react/dist/video-react.css'

const VideoPlayer = () => {
    return (
        <div>
            <link
                rel="stylesheet"
                href="https://video-react.github.io/assets/video-react.css"
            />
        </div>
    )
  }

  export default VideoPlayer;
